export const BEGIN = "BEGIN";
export const RECEIVE = "RECEIVE";

export const begin = (method) => (
    {
        type: BEGIN,
        method
    }
)

export const receive = (method, content) => (
    {
        type: RECEIVE,
        method,
        content
    }
);
